snippet.description:
Ci siamo! Dopo tanta attesa e tanto hype è finalmente disponibile Mafia The Old Country (Terra Madre in italiano). Il nuovo capitolo di questa celebre serie, a cura di Hangar 13, ci avrà convinto appieno? Scopritelo guardando questa recensione che ho curato particolarmente e che, a prescindere dal giudizio sul gioco, mi rende orgoglioso per... più di un motivo!

Versione recensita: PC (di fascia altissima)

INDICE DEGLI ARGOMENTI:
0:00 - Intro;
0:51 - Analisi della TRAMA (no spoiler);
4:29 - GAMEPLAY;
4:43 - Mappa di gioco e varietà delle ambientazioni;
6:21 - Esplorazione;
7:00 - Varietà delle missioni;
7:47 - Fasi stealth e problemi di IA;
9:04 - Shooting e sezioni di combat con armi da fuoco;
9:46 - Combattimento con il coltello 1vs1;
11:26 - Gare a cavallo e in auto;
11:59 - Guida e esplorazione con i veicoli e i cavalli;
12:22 - Potenziamenti (ornamenti) e oggetti acquistabili;
13:33 - Più forma che sostanza? Un prodotto eccessivamente derivativo;
14:27 - GRAFICA & SONORO;
16:19 - Caricamenti piuttosto lunghi;
16:31 - Musiche, effetti sonori e doppiaggio siciliano;
19:01 - Piccolo annuncio che ci rende orgogliosi;
21:34 - VOTO, PRO E CONTRO;
21:43 - CONCLUSIONI FINALI;
23:13 - Considerazioni soggettive e saluti.

